// import { Routes, Route } from 'react-router-dom'

function DogDetails({dogs}){
    console.log('dogs')
    const {name} = userParams()
    const {eachDog} = dogs
    let dog;
    for(i=0; i < eachDog.length; i++) {
        if(eachDog[i].name === name) {
            dog = name
        }
    }
    function Facts(dog) {
        for(let fact of dog.facts) {
            <li>fact</li>
        }
    }


    return (
        <>
            <h1>{dog.name}</h1>
                <h3>{dog.age}</h3>
                <img src={dog.src}></img>
                <h2>Facts</h2>
                    <ul>
                        {Facts}

                    </ul>
        </>
    )
}



export default DogDetails
